    langs:
      - typeScript
    type: interface
    summary: >-
      Represents health evaluation for cluster nodes in an upgrade domain,
      containing health

      evaluations for each unhealthy node that impacted current aggregated
      health state. Can be

      returned when evaluating cluster health during cluster upgrade and the
      aggregated health state

      is either Error or Warning.
    extends:
      name: azure-servicefabric.HealthEvaluation
    package: azure-servicefabric
